// Mock licensekeymanager plugin for GPL TinyMCE
// This prevents 404 errors when using GPL license
(function() {
    'use strict';
    
    // Mock license key manager plugin
    tinymce.PluginManager.add('licensekeymanager', function() {
        // Mock license validation for GPL
        this.validateLicense = function(key) {
            return key === 'gpl' || key === 'gpl-open-source' || key === 'gpl-license';
        };
        
        this.setLicenseKey = function(key) {
            // Accept GPL license keys
            if (key === 'gpl' || key === 'gpl-open-source' || key === 'gpl-license') {
                return true;
            }
            return false;
        };
        
        return {
            validateLicense: this.validateLicense,
            setLicenseKey: this.setLicenseKey
        };
    });
})();
